import React, { Component } from "react";

class User extends Component
{
    constructor ()
    {
        super()
        this.state = {
            name: 'abc',
            email: 'abc@test.com'
        }
    }

    render()
    {
        console.log('render', this.state.name)
        return(
            <div>
                <h1>React</h1>
                <button onClick={() => {this.setState({name: 'xyz', email: 'xyz@test'})}}>Update</button>
            </div>
        )
    }
}

export default User
